{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/narendra66/cyclistic-nk-proj?scriptVersionId=137444299\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"These are libraries which needs to be enabled to make it sucess of this proeject.","metadata":{}},{"cell_type":"code","source":"# To use rbindlist This is start of the program, where I had installed packages.\n# I have also added libraries, and stored them\ninstall.packages(\"data.table\")\nlibrary(data.table)\ninstall.packages(\"readr\")\nlibrary(readr)\ninstall.packages(\"dplyr\")\nlibrary(dplyr)\ninstall.packages(\"hms\")\nlibrary(hms)\ninstall.packages(\"lubridate\")\nlibrary(lubridate)\ninstall.packages(\"tidyr\")\nlibrary(tidyr)\n\n# To use function read_csv()\n# To analyze and calculate\n# To transfer data frames , we can add more.\n# To enter dates and time properly\n\n\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T03:54:41.30448Z","iopub.execute_input":"2023-07-21T03:54:41.30636Z","iopub.status.idle":"2023-07-21T03:57:26.3957Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"This will ensure additional libraries has been loaded for other operations of cleanin & analysis.\n","metadata":{}},{"cell_type":"code","source":"# In this code I ensured that csv files are loaded \n\ndf01csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/jan_22-divvy-tripdata.csv')\ndf02csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/feb_22-divvy-tripdata.csv')\ndf03csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/mar_22-divvy-tripdata.csv')\ndf04csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/apr_22-divvy-tripdata.csv')\ndf05csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/may_22-divvy-tripdata.csv')\ndf06csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/jun_22-divvy-tripdata.csv')\ndf07csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/jul_22-divvy-tripdata.csv')\ndf08csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/aug_22-divvy-tripdata.csv')\ndf09csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/sep_22-divvy-tripdata.csv')\ndf10csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/oct_22-divvy-tripdata.csv')\ndf11csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/nov_22-divvy-tripdata.csv')\ndf12csv <- read_csv('/kaggle/input/cyclistic-nk-proj-google-certfication/dec_22-divvy-tripdata.csv')\n#Create master data frame uisng rbindlist()\nmas_dfcsv <- rbindlist(list(df01csv, df02csv, df03csv, df04csv, df05csv, df06csv, df07csv, df08csv, df09csv, df10csv, df11csv, df12csv))\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T03:57:54.076865Z","iopub.execute_input":"2023-07-21T03:57:54.079127Z","iopub.status.idle":"2023-07-21T03:58:33.18008Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#Check number of rows which -5.63 Million rides\nnrow(mas_dfcsv)\n\n# To check Tibble\nhead(mas_dfcsv,n = 10)\n\n# Pre-cleaning: Code to remove records with rdl_2 < 1 min (removed = 57583 records)\nmas_dfcsv <- mas_dfcsv[mas_dfcsv$rdl_2 >= 1,]\nhead(mas_dfcsv,n = 10)\n\n#Now Check number of rows which -5.58 Million ( 5581561) rides\nnrow(mas_dfcsv)\n\n\n# Created temporary dataframe, to make sure we do not disturb the main dataframe.\nan_mast <- mas_dfcsv\n\n#Now Check number of rows for rides\nnrow(an_mast)\n\n# Create the new dataframe for analysis based on time\n\nan_mast1                 <-  an_mast  # Do not touch this after st\nan_mast1$quarter_of_year <-  quarter(an_mast$started_at)\nan_mast1$month           <-  month(an_mast$started_at)\nan_mast1$day             <-  day(an_mast$started_at)\nan_mast1$hour            <-  hour(an_mast$started_at) \nan_mast1$minute          <-  minute(an_mast$started_at)\n\n#Slightly clean the an_mast1\n\nan_mast1 <- distinct(an_mast1) #remove duplicate rows \n#Now Check number of rows for rides 5581561 proves that there is no duplicates.\nnrow(an_mast1)\n#Now check structure of an_mast1\nstr(an_mast1)\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T03:58:49.101916Z","iopub.execute_input":"2023-07-21T03:58:49.103613Z","iopub.status.idle":"2023-07-21T03:59:11.828932Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"The entire code block ensures all functions are actively working,supporting libraries are intialised.First step being installing the relevant packages. We also add, more columns like quarter of the year,month,day,minute for further calculations to main dataframe.","metadata":{}},{"cell_type":"code","source":"#Analysis starts from Here.\n\n# Ex-5 To find Annual electric and classic riders in total minutes,\nyr_rid_sum <- an_mast1 %>%\n  group_by(rideable_type, member_casual) %>%\n  summarize(total_mem_rid_min = sum(minute))\nprint(yr_rid_sum)\n\n# Ex-4 To find Annual casual and member rides\n\nyr_rid_count <- an_mast1 %>%\n  group_by(rideable_type, member_casual) %>%\n  count()\nprint(yr_rid_count)\n\nyr_rid_total <- an_mast1 %>%\n  group_by(rideable_type) %>%\n  summarize(total_rid_min = sum(minute))\nprint(yr_rid_total)\n\nyr_rider_total <- an_mast1 %>%\n  group_by(member_casual) %>%\n  summarize(member_casual_min = sum(minute))\nprint(yr_rider_total)\n\n# Q1 To find the prefered bike type \n\npref_bike_type <- an_mast1 %>%\n  group_by(rideable_type) %>%\n  count()\nprint(pref_bike_type)\n\n\n# Q4 Study of significant month which is higher number of casual riders compared to member riders\ncount_mnth <- an_mast1 %>%\n  group_by(month) %>%\n  summarize(member_count = sum(member_casual == \"member\"),\n  casual_count = sum(member_casual == \"casual\"))\nprint(count_mnth)  \n\n# Q2 To find the bike rides per quarter by member /casual for whole year\n\ncount_quarter <- an_mast1 %>%\n  group_by(quarter_of_year) %>%\n  summarize(member_count = sum(member_casual == \"member\"),\n  casual_count = sum(member_casual == \"casual\"))\nprint(count_quarter)  \n\n#Ex-2 To count week end count \ncount_weekend <- an_mast1 %>%\n  filter(day_of_week >= 6) %>%\n  summarize(weekend_count = n())\nprint(count_weekend)\n\n#Ex-3 To count week day count \n\ncount_weekday <- an_mast1 %>%\n  filter(day_of_week < 6) %>%\n  summarize(weekday_count = n())\nprint(count_weekday)\n\n#Q3 To count every day of week day count, works \n\ncount_everday <- an_mast1 %>%\n  group_by(day_of_week, member_casual) %>%\n  summarize(count = n())\nprint(count_everday)\n#write_csv(count_everday,'/local_system/cnt_da_wk.csv')\n\n#Ex-1 To understand the casual count monthwise and see which is signiificant month, works \n\ncas_cnt_mnth <- an_mast1 %>%\n  group_by(month) %>%\n  summarize(member_count = sum(member_casual == \"member\"),\n            casual_count = sum(member_casual == \"casual\"))\nprint(cas_cnt_mnth)  \n\n# Q7 The average duration in hours with respect to members ,casual in a week, works.\navg_in_week <- an_mast1 %>%\n  group_by(day_of_week, member_casual) %>%\n  summarize(Average = mean(hour) )\nprint(avg_in_week)\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T04:00:50.351911Z","iopub.execute_input":"2023-07-21T04:00:50.353835Z","iopub.status.idle":"2023-07-21T04:00:54.964354Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"This block above analizes the data set for various business questions to be answered in the project, like, peak days of week, no's required for further analysis and tableau interfacing. All tibbles received as output of codes has been converted to csv files and restored back into to this project data set, as seperate files. Files which are named other than month dated or files of o/p of this program.","metadata":{}},{"cell_type":"code","source":"# Q8 to study which block is majorly used by riders\n# column for  segment_of_day: Night, Morning, Afternoon, Evening\nan_mast1  <-  an_mast1 %>% mutate(segment_of_day = \n                                             case_when(hour == \"0\" ~ \"Night\",\n                                                       hour == \"1\" ~ \"Night\",\n                                                       hour == \"2\" ~ \"Night\",\n                                                       hour == \"3\" ~ \"Night\",\n                                                       hour == \"4\" ~ \"Night\",\n                                                       hour == \"5\" ~ \"Night\",\n                                                       hour == \"6\" ~ \"Morning\",\n                                                       hour == \"7\" ~ \"Morning\",\n                                                       hour == \"8\" ~ \"Morning\",\n                                                       hour == \"9\" ~ \"Morning\",\n                                                       hour == \"10\" ~ \"Morning\",\n                                                       hour == \"11\" ~ \"Morning\",\n                                                       hour == \"12\" ~ \"Afternoon\",\n                                                       hour == \"13\" ~ \"Afternoon\",\n                                                       hour == \"14\" ~ \"Afternoon\",\n                                                       hour == \"15\" ~ \"Afternoon\",\n                                                       hour == \"16\" ~ \"Afternoon\",\n                                                       hour == \"17\" ~ \"Afternoon\",\n                                                       hour == \"18\" ~ \"Evening\",\n                                                       hour == \"19\" ~ \"Evening\",\n                                                       hour == \"20\" ~ \"Evening\",\n                                                       hour == \"21\" ~ \"Evening\",\n                                                       hour == \"22\" ~ \"Evening\",\n                                                       hour == \"23\" ~ \"Evening\")\n)\n\n#-----morning-------\n#total rides by member type \n  mor_day     <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(segment_of_day == \"Morning\") %>% \n  count(segment_of_day)\n\n  aft_day     <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(segment_of_day == \"Afternoon\") %>% \n  count(segment_of_day)\n\n  eve_day     <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(segment_of_day == \"Evening\") %>% \n  count(segment_of_day)\n  \n  nig_night     <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(segment_of_day == \"Night\") %>% \n  count(segment_of_day)\n\nprint(mor_day)\nprint(aft_day)\nprint(eve_day)\nprint(nig_night)\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T04:01:36.513117Z","iopub.execute_input":"2023-07-21T04:01:36.514975Z","iopub.status.idle":"2023-07-21T04:01:49.659317Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"This block of the code identifies which part of the day cyclistic bikes are being used by users, like members and casual riders. code analysis creates a series of tibbles which are collected as csv file as tim_of_day.csv for use in tableau","metadata":{}},{"cell_type":"code","source":"# Q5 To investigate the favourite station\nfav_new_start <- an_mast1 %>%\n   rename(station_name = start_station_name) %>%\n   group_by(station_name) %>%\n   summarize(member_count = sum(member_casual == \"member\"),\n             casual_count = sum(member_casual == \"casual\"))\nprint(fav_new_start)\n\nfav_new_end   <- an_mast1 %>%\n   rename(station_name = end_station_name) %>%\n   group_by(station_name) %>%\n   summarize(member_count = sum(member_casual == \"member\"),\n             casual_count = sum(member_casual == \"casual\"))\nprint(fav_new_end)\n\npeak_stn_fav  <- bind_rows(fav_new_start,fav_new_end)%>%\n     group_by(station_name) %>%\n     summarize(memb_count = sum(member_count),\n               cas_count = sum(casual_count))\nprint(peak_stn_fav)\n     \ntotal_peak_stn <- peak_stn_fav %>%\n     summarize(sum_memb_count = sum(memb_count),\n               sum_cas_count = sum(cas_count))\n\nprint(total_peak_stn)\n\n#Q5 For annual members/casual - top visiting\n\ndesc_fav_st <- peak_stn_fav[rev(order(peak_stn_fav$memb_count)),]\nhead(desc_fav_st, n = 15)\n\ndesc_fav_st2 <- peak_stn_fav[rev(order(peak_stn_fav$cas_count)),]\nhead(desc_fav_st2, n = 15)\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T04:02:06.971755Z","iopub.execute_input":"2023-07-21T04:02:06.973477Z","iopub.status.idle":"2023-07-21T04:02:08.05993Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"This code block analizes the station which was visited by the most riders, which was identified by the code block and presented as tibble, is used to get the details of most visited route/ station, which presents clear picture how the casual and member riders use the bike. the tibble is stored in csv for in the dataset as seperate file of csv, for further processing and cleaning and dat viz purpose","metadata":{}},{"cell_type":"code","source":"# Q6 To find out what is the season which is peak station\n\nan_mast1 <- an_mast1 %>% mutate(season = case_when(\n  month %in% c(\"3\", \"4\", \"5\") ~ \"Spring\",\n  month %in% c(\"6\", \"7\", \"8\") ~ \"Summer\",\n  month %in% c(\"9\", \"10\", \"11\") ~ \"Fall\",\n  month %in% c(\"12\", \"1\", \"2\") ~ \"Winter\",\n  TRUE ~ \"Unknown\"  # Default value to handle unexpected or missing values\n))\n\n\n# Q6 To find out what is the season which is peak station\n\n\n\n  sum_season <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(season == \"Summer\") %>% \n  count(season)\n  print(sum_season)\n  \n  wint_season <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(season == \"Winter\") %>% \n  count(season)\n  print(wint_season)\n\n  fall_season <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(season == \"Fall\") %>% \n  count(season)\n  print(fall_season)\n\n  spring_season <-  an_mast1 %>%\n  group_by(member_casual) %>% \n  filter(season == \"Spring\") %>% \n  count(season)\n  print(spring_season)\n\n  \n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T04:03:42.463867Z","iopub.execute_input":"2023-07-21T04:03:42.465615Z","iopub.status.idle":"2023-07-21T04:04:09.098037Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"The above code block contains the code  series finds out what is the peak season for the bike users and how it varies for different users like casual/member. We can use this analyzis to drill down to three months plan accordingly. The data and the program points out sum of all rides/season which helps to understand the seasonal usage pattern.","metadata":{}},{"cell_type":"code","source":"# write_csv(an_mast1,\"cl_mast_cycl.csv\") Enable this step \n#if you want to have copy of cleaned csv file master of this project\n\nhead(an_mast1, n = 10)\nstr(an_mast1)\n","metadata":{"execution":{"iopub.status.busy":"2023-07-21T04:04:25.470351Z","iopub.execute_input":"2023-07-21T04:04:25.47205Z","iopub.status.idle":"2023-07-21T04:04:25.55902Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![](https://storage.googleapis.com/kagglesdsdata/datasets/3538181/6166756/pek_mnt.png?X-Goog-Algorithm=GOOG4-RSA-SHA256&X-Goog-Credential=databundle-worker-v2%40kaggle-161607.iam.gserviceaccount.com%2F20230720%2Fauto%2Fstorage%2Fg